import axios from "axios";

const UBICACION_BASE_REST_API_URL ='http://localhost:8080/api/v1/ubicacion'

class UbicacionService{

    getAllUbicacion(){
        return axios.get(UBICACION_BASE_REST_API_URL)
    }

}



export default new UbicacionService();
